import React, { useState, useEffect } from 'react';
import './VisitTracker.css';

function VisitTracker() {
  const [visits, setVisits] = useState([]);
  const [todayVisits, setTodayVisits] = useState(0);
  const [totalVisits, setTotalVisits] = useState(0);
  const [mostVisitedPage, setMostVisitedPage] = useState({ page: 'ÊöÇÊó†Êï∞ÊçÆ', count: 0 });
  const [dateRange, setDateRange] = useState('all'); // 'all', 'today', 'week', 'month'
  const [filteredVisits, setFilteredVisits] = useState([]);

  // ÂàùÂßãÂåñËÆøÈóÆÊï∞ÊçÆ
  useEffect(() => {
    loadVisitData();
    updateVisitStats();
  }, [dateRange]);

  // ‰∏∫‰∫ÜÊºîÁ§∫ÁõÆÁöÑÔºåÊ∑ªÂä†‰∏Ä‰∫õÂàùÂßãÊ®°ÊãüÊï∞ÊçÆ
  useEffect(() => {
    const storedVisits = localStorage.getItem('visitRecords');
    if (!storedVisits || JSON.parse(storedVisits).length === 0) {
      // ÂàõÂª∫‰∏Ä‰∫õÊ®°ÊãüËÆøÈóÆÊï∞ÊçÆ
      const mockVisits = [
        {
          timestamp: new Date(Date.now() - 2 * 60 * 60 * 1000).toISOString(),
          page: 'travel',
          userInfo: 'Ê∏∏ÂÆ¢',
          deviceInfo: 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36'
        },
        {
          timestamp: new Date(Date.now() - 1.5 * 60 * 60 * 1000).toISOString(),
          page: 'tasks',
          userInfo: 'Ê∏∏ÂÆ¢',
          deviceInfo: 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36'
        },
        {
          timestamp: new Date(Date.now() - 60 * 60 * 1000).toISOString(),
          page: 'games',
          userInfo: 'Ê∏∏ÂÆ¢',
          deviceInfo: 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36'
        },
        {
          timestamp: new Date(Date.now() - 30 * 60 * 1000).toISOString(),
          page: 'realestate',
          userInfo: 'Ê∏∏ÂÆ¢',
          deviceInfo: 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36'
        },
        {
          timestamp: new Date(Date.now() - 15 * 60 * 1000).toISOString(),
          page: 'travel',
          userInfo: 'Ê∏∏ÂÆ¢',
          deviceInfo: 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36'
        },
        {
          timestamp: new Date(Date.now() - 5 * 60 * 1000).toISOString(),
          page: 'jokes',
          userInfo: 'Ê∏∏ÂÆ¢',
          deviceInfo: 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36'
        }
      ];

      // ‰øùÂ≠òÊ®°ÊãüÊï∞ÊçÆ
      localStorage.setItem('visitRecords', JSON.stringify(mockVisits));

      // ÈáçÊñ∞Âä†ËΩΩÊï∞ÊçÆ
      loadVisitData();
      updateVisitStats();
    }
  }, []);

  // ‰ªélocalStorageÂä†ËΩΩËÆøÈóÆÊï∞ÊçÆ
  const loadVisitData = () => {
    try {
      const storedVisits = localStorage.getItem('visitRecords');
      if (storedVisits) {
        const parsedVisits = JSON.parse(storedVisits);
        setVisits(parsedVisits);
        applyDateFilter(parsedVisits);
      }
    } catch (error) {
      console.error('Âä†ËΩΩËÆøÈóÆËÆ∞ÂΩïÂ§±Ë¥•:', error);
      setVisits([]);
      setFilteredVisits([]);
    }
  };

  // Â∫îÁî®Êó•ÊúüËøáÊª§
  const applyDateFilter = (allVisits) => {
    const now = new Date();
    let filtered = [...allVisits];

    switch (dateRange) {
      case 'today':
        filtered = allVisits.filter(visit => {
          const visitDate = new Date(visit.timestamp);
          return visitDate.toDateString() === now.toDateString();
        });
        break;
      case 'week':
        const weekAgo = new Date(now.getTime() - 7 * 24 * 60 * 60 * 1000);
        filtered = allVisits.filter(visit => new Date(visit.timestamp) >= weekAgo);
        break;
      case 'month':
        const monthAgo = new Date(now.getTime() - 30 * 24 * 60 * 60 * 1000);
        filtered = allVisits.filter(visit => new Date(visit.timestamp) >= monthAgo);
        break;
      default:
        // ÊòæÁ§∫ÊâÄÊúâËÆ∞ÂΩï
        break;
    }

    setFilteredVisits(filtered);
  };

  // Êõ¥Êñ∞ËÆøÈóÆÁªüËÆ°Êï∞ÊçÆ
  const updateVisitStats = () => {
    const now = new Date();
    const today = now.toDateString();

    // ËÆ°ÁÆóÊÄªËÆøÈóÆÊ¨°Êï∞
    setTotalVisits(visits.length);

    // ËÆ°ÁÆó‰ªäÊó•ËÆøÈóÆÊ¨°Êï∞
    const todayCount = visits.filter(visit => {
      const visitDate = new Date(visit.timestamp);
      return visitDate.toDateString() === today;
    }).length;
    setTodayVisits(todayCount);

    // ÊâæÂá∫ËÆøÈóÆÊ¨°Êï∞ÊúÄÂ§öÁöÑÈ°µÈù¢
    const pageCounts = {};
    visits.forEach(visit => {
      pageCounts[visit.page] = (pageCounts[visit.page] || 0) + 1;
    });

    let maxPage = 'ÊöÇÊó†Êï∞ÊçÆ';
    let maxCount = 0;
    for (const page in pageCounts) {
      if (pageCounts[page] > maxCount) {
        maxCount = pageCounts[page];
        maxPage = page;
      }
    }
    setMostVisitedPage({ page: maxPage, count: maxCount });
  };

  // Ê†ºÂºèÂåñÊó∂Èó¥Êà≥
  const formatTimestamp = (timestamp) => {
    return new Date(timestamp).toLocaleString('zh-CN', {
      year: 'numeric',
      month: '2-digit',
      day: '2-digit',
      hour: '2-digit',
      minute: '2-digit',
      second: '2-digit'
    });
  };

  // Ê∏ÖÁ©∫ÊâÄÊúâËÆøÈóÆËÆ∞ÂΩï
  const clearAllVisits = () => {
    if (window.confirm('Á°ÆÂÆöË¶ÅÊ∏ÖÁ©∫ÊâÄÊúâËÆøÈóÆËÆ∞ÂΩïÂêóÔºüÊ≠§Êìç‰Ωú‰∏çÂèØÊÅ¢Â§ç„ÄÇ')) {
      localStorage.removeItem('visitRecords');
      setVisits([]);
      setFilteredVisits([]);
      setTotalVisits(0);
      setTodayVisits(0);
      setMostVisitedPage({ page: 'ÊöÇÊó†Êï∞ÊçÆ', count: 0 });
    }
  };

  // Ëé∑ÂèñÈ°µÈù¢ÁöÑ‰∏≠ÊñáÂêçÁß∞
  const getPageDisplayName = (pageKey) => {
    const pageNames = {
      'travel': 'ÊóÖÊ∏∏ËÆ°Âàí',
      'games': 'Ê∏∏Êàè‰∏≠ÂøÉ',
      'jokes': 'Á¨ëËØùÁÆ°ÁêÜ',
      'tasks': '‰ªªÂä°ÂàóË°®',
      'realestate': 'Ê∑±Âú≥Êàø‰∫ß‰ø°ÊÅØ',
      'analytics': 'Êï∞ÊçÆÂàÜÊûê',
      'unknown': 'Êú™Áü•È°µÈù¢'
    };
    return pageNames[pageKey] || pageKey;
  };

  return (
    <div className="visit-tracker-container">
      <h2>üìä ËÆøÈóÆËÆ∞ÂΩïÁªüËÆ°</h2>

      {/* ÁªüËÆ°Ê¶ÇËßà */}
      <div className="stats-overview">
        <div className="stat-card">
          <div className="stat-number">{totalVisits}</div>
          <div className="stat-label">ÊÄªËÆøÈóÆÊ¨°Êï∞</div>
        </div>
        <div className="stat-card">
          <div className="stat-number">{todayVisits}</div>
          <div className="stat-label">‰ªäÊó•ËÆøÈóÆÊ¨°Êï∞</div>
        </div>
        <div className="stat-card">
          <div className="stat-number">{mostVisitedPage.count}</div>
          <div className="stat-label">
            ÊúÄÂ∏∏ËÆøÈóÆÈ°µÈù¢<br/>
            <span className="most-visited-page">{getPageDisplayName(mostVisitedPage.page)}</span>
          </div>
        </div>
      </div>

      {/* Êó•ÊúüËåÉÂõ¥Á≠õÈÄâ */}
      <div className="filter-section">
        <label>ÈÄâÊã©Êó∂Èó¥ËåÉÂõ¥Ôºö</label>
        <select 
          value={dateRange} 
          onChange={(e) => setDateRange(e.target.value)}
          className="date-filter"
        >
          <option value="all">ÂÖ®ÈÉ®ËÆ∞ÂΩï</option>
          <option value="today">‰ªäÊó•</option>
          <option value="week">Ëøë7Â§©</option>
          <option value="month">Ëøë30Â§©</option>
        </select>
        <button className="clear-btn" onClick={clearAllVisits}>
          Ê∏ÖÁ©∫ËÆ∞ÂΩï
        </button>
      </div>

      {/* ËÆøÈóÆËÆ∞ÂΩïÂàóË°® */}
      <div className="visits-list-container">
        <h3>ËÆøÈóÆËÆ∞ÂΩïÂàóË°® ({filteredVisits.length} Êù°)</h3>
        <div className="visits-list">
          {filteredVisits.length === 0 ? (
            <div className="empty-state">
              ÊöÇÊó†ËÆøÈóÆËÆ∞ÂΩï
            </div>
          ) : (
            filteredVisits
              .slice()
              .reverse() // ÂÄíÂ∫èÊéíÂàóÔºåÊúÄÊñ∞ÁöÑÂú®ÂâçÈù¢
              .map((visit, index) => (
                <div key={index} className="visit-item">
                  <div className="visit-time">{formatTimestamp(visit.timestamp)}</div>
                  <div className="visit-info">
                    <div className="visit-page">
                      È°µÈù¢Ôºö{getPageDisplayName(visit.page)}
                    </div>
                    {visit.userInfo && (
                      <div className="visit-user">
                        Áî®Êà∑Ôºö{visit.userInfo}
                      </div>
                    )}
                    {visit.deviceInfo && (
                      <div className="visit-device">
                        ËÆæÂ§áÔºö{visit.deviceInfo}
                      </div>
                    )}
                  </div>
                </div>
              ))
          )}
        </div>
      </div>

      {/* È°µÈù¢ËÆøÈóÆÁªüËÆ°ÂõæË°® */}
      <div className="page-stats-section">
        <h3>È°µÈù¢ËÆøÈóÆÁªüËÆ°</h3>
        <div className="page-stats">
          {(() => {
            // ËÆ°ÁÆóÂêÑÈ°µÈù¢ÁöÑËÆøÈóÆÊ¨°Êï∞
            const pageCounts = {};
            visits.forEach(visit => {
              pageCounts[visit.page] = (pageCounts[visit.page] || 0) + 1;
            });

            // ËΩ¨Êç¢‰∏∫Êï∞ÁªÑÂπ∂ÊéíÂ∫è
            const sortedPages = Object.entries(pageCounts)
              .map(([page, count]) => ({ page, count }))
              .sort((a, b) => b.count - a.count);

            return sortedPages.map((item, index) => {
              const percentage = (item.count / visits.length) * 100;
              return (
                <div key={index} className="page-stat-item">
                  <div className="page-stat-label">
                    {getPageDisplayName(item.page)} ({item.count}Ê¨° - {percentage.toFixed(1)}%)
                  </div>
                  <div className="page-stat-bar">
                    <div 
                      className="page-stat-fill" 
                      style={{ width: `${percentage}%` }}
                    ></div>
                  </div>
                </div>
              );
            });
          })()}
        </div>
      </div>
    </div>
  );
}

export default VisitTracker;
